    "actsOfHumanTraffickingInvoluntaryPrisonLabourIndenturedBonded" : MessageLookupByLibrary.simpleMessage("Acts of human trafficking, involuntary prison, labour, indentured, bonded, slave or other forms of forced labour are prohibited within the business and its value-chain. To that end, businesses must not recruit, harbour, transport, provide, or obtain a person directly or through a third party for compelled labour through the use of force, fraud, coercion or as a means of debt repayment. Workers are not required to provide deposits of value, including identity papers or passports, to their business and are able to leave the business after giving reasonable notice. Suppliers must monitor any third party which assists them to recruit/hire workers, to ensure that job seekers are not compelled to work through force, deception, intimidation, coercion, or as a punishment for holding/expressing political views, or have their original identification papers held by the third party."),
    "afterTheInitialSurveyYouWillReceive10QuestionsEachMonth" : MessageLookupByLibrary.simpleMessage("As part of continuous monitoring, after the initial workplace assessment, you will be asked to answer some questions on a regular basis. You will be notified on this app when your next questionnaire is ready."),
    "allWorkersMustHaveALegallyBindingWrittenContractOfEmployment" : MessageLookupByLibrary.simpleMessage("All workers must have a legally binding written contract of employment, signed by the business and the worker that includes the: job description and duties; hours of work; rate of pay; overtime regulation; benefits under the relevant labour and social security legislation of the region; and the notice period for termination. The business must have in place written policies and procedures made available to all workers governing all aspects of the employment relationship. All workers, irrelevant of their title or classification, will receive the protection of national and international labour and social security laws and regulations arising under a regular business-worker relationship. These obligations will not be avoided by classifying a worker as an independent contractor or other non-worker."),
