    "businessesMustProvideASafeAndHealthyWorkplaceAndTake" : MessageLookupByLibrary.simpleMessage("Businesses must provide a safe and healthy workplace, and take effective measures to identify and prevent potential health and safety accidents and injury to health arising out of, linked with, or occurring in the course of work or as a result of the operation of business’ facilities. The business shall take a proactive approach to health and safety by implementing timely policies, systems and training designed to prevent accidents, injuries and protect worker health.  Particular  attention should be given to the health and safety requirements of migrant, foreign and other vulnerable workers."),
