    "privacyPolicyContent" : MessageLookupByLibrary.simpleMessage("Purpose\nThe vision of slavefreetrade is a “A World Made in Freedom”.  We use data and analysis to give us the evidence to achieve our vision and mission. \n\nScope\nThis privacy notice applies to all personal data obtained and used by slavefreetrade for the purpose of achieving our mission “Powering human rights in workplaces globally”. \n\nData Privacy Policy\nOur mission demands target audience behaviour change.  Thus, access to data is granted based on the following question: “What does the target audience need to know to modify their behaviour towards becoming slave free?”. Slavefreetrade provides information to this target audience whilst protecting individual privacy and commercial in confidence information. At slavefreetrade we take privacy seriously. Identifiable Individual answers are NEVER published. Commercial in confidence information such as a detailed member’s supply chain are also protected. \n\nWhat privacy data do we collect in Libertas People?\n\t-\tDescription\n\t\tA survey of staff in a workplace and their assessment of their human rights in the workplace.\n\t-\tPersonal details\n\t\tName, email, phone, IMEI  \n\n\nHow do we collect your data?\nYou directly provide slavefreetrade with most of the data we collect.  We collect data and process data when you: \n\t1)\tBecome a member organisation and fill out our Web Survey or Interview. \n\t2)\tVolunteer to fill out our Workforce Assessment via Web App or Mobile App survey. \n\t3)\tSign up to our Mobile App as a Good Campaigner. \n\t4)\tSubscribe to our website or visit our website (via cookies). \n\t5)\tConnect with us on social media \n\nHow will we use your data?\nSlavefreetrade uses your data so that we can\n\t1)\tRecord an organisations performance in human rights and track the human rights record of its supply chain. Establish a working relationship with the organisation contact to improve human rights.\n\t2)\tRecord an individual’s actual experience of human rights in the workplace and ensure the record is authentic without duress or persuasion.\n\t3)\tGoods Campaign – Use a groundswell of activists to influence organisational change to end modern slavery.\n\t4)\tEmail our subscribers of the latest news and developments.\n\t5)\tUse our social media connections to update and influence a global movement to reduce modern slavery. \n\nHow do we store your data?\nSlavefreetrade stores your data at X\nDescribe security precautions taken here\nDescribe time period here (retention period)\nDescribe de-identification process here  \n\nMarketing\nWhen you subscribe to slavefreetrade via our website we will send you updates and news from slavefreetrade.  If you have agreed to subscribe you may always opt out at a later date. \nYou have the right at any time to stop slavefreetrade from contacting you. \nIf you wish to unsubscribe please click here: xxxxxxxx \n\nWhat are your data protection rights?\nSlavefreetrade would like to make sure you are fully aware of all your data protection rights.  Every user is entitled to the following: \n\t-\tThe right to access – You have the right to request slavefreetrade for copies of your personal data. \n\t-\tThe right to rectification – You have the right to request that slavefreetrade correct any information you believe is inaccurate.  You also have the right to request slavefreetrade complete information you believe is incomplete. \n\t-\tThe right to erasure – You have the right to request that slavefreetrade erase your personal data under certain conditions. \n\t-\tThe right to restrict processing – You have the right to request that slavefreetrade restrict the processing of your personal data, under certain conditions. \n\t-\tThe right to object to processing – You have the right to object to slavefreetrade processing your personal data, under certain conditions. \n\t-\tThe right to data portability – You have the right to request that slavefreetrade transfer the data that we have collected to another organisation, or directly to you, under certain conditions. \n\t-\tIf you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us at our email: \nXxx \nxxxxxx \n\nPrivacy policies on other websites\nSlavefreetrade website contains links to other websites.  Our privacy policy only applies to our website and data, so if you link on another website you should read their privacy policy. \n\nChanges to our privacy policy\nOur privacy policy is under regular review and we place updates on this web page.  The privacy policy was last updated on xxxx \n\nHow to contact us\nIf you have any questions about slavefreetrades privacy notice, the data we hold on you or you would like to exercise of your data protection rights, please do not hesitate to contact us: \nEmail \nCall \nWrite \n\nHow to contact the appropriate authority\nShould you wish to report a complaint or if you feel slavefreetrade has not addressed your concern in a satisfactory manner, you may contact the Information Commissioner’s Office \nEmail \nAddress \n"),
