    "workersMustHaveAccessToEffectiveGrievanceMechanisms" : MessageLookupByLibrary.simpleMessage("Workers must have access to effective grievance mechanisms. Businesses must conduct regular investigations of their value chains to highlight and prevent incidents of slavery. Businesses must also allow workers to report grievances without fear of penalty, dismissal or reprisal, and provide effective local remedy for stakeholders’ grievances related to any of slavefreetrade’s principles. The grievance mechanism must include provision to refer grievances to external in/formal dispute resolution fora."),
